  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108071 includes chemical,
  discrete sample, physical and profile data collected from KNORR in the South Pacific
  Ocean from 2005-08-21 to 2005-10-06 and retrieved during cruise CLIVAR_AAIW05. These
  data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113
  (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride (CCL4), DISSOLVED
  INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE,
  Partial pressure (or fugacity) of carbon dioxide, SALINITY, SILICATE, WATER TEMPERATURE
  and pH. The instruments used to collect these data include Alkalinity titrator,
  CTD, Coulometer for DIC measurement and bottle. These data were collected by Andrew
  Dickson, Lynne Talley and James Swift of Scripps Institution of Oceanography as
  part of the CLIVAR_AAIW05 data set.nnThe International CLIVAR Global Ocean Carbon
  and Repeat Hydrography Program carries out a systematic and global re-occupation
  of select WOCE/JGOFS hydrographic sections to quantify changes in storage and transport
  of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"owner_org\":
